import React from "react";
import BreweryItem from "./BreweryItem";
import Spinner from "../layout/Spinner";

const Breweries = () => {
  return (
    <div style={breweryStyle}>
      <BreweryItem />
    </div>
  );
};

const breweryStyle = {
  display: "grid",
  gridTemplateColumns: "repeat(3, 1fr)",
  gridGap: "1rem"
};

export default Breweries;
